 [121090003] = { 121090003, "", 12, 1090, 0, 9999, 10026, 0, 0, 0, 0, 0, 0, "中州大陆重组，魑魅魍魉来袭。活动期间，每天<color=#4aff11>14点</color>、<color=#4aff11>19点</color>和<color=#4aff11>22点</color>，刑天会在世界地图1线刷新，击杀必得绑元卡，更有机会获得极品2星红装、仙翼披风皮肤卡！经验熊猫无法拾取刑天掉落奖励，大家快来抢哦！", "", "", "", "" }, 
 [121090004] = { 121090004, "", 12, 1090, 0, 9999, 10033, 0, 0, 0, 0, 0, 0, "活动期间，完成指定档次的婚礼，即可领取对应奖励，无需离婚，可重复提亲。每档奖励均可领一次哦！", "", "", "", "" }, 
